import { NavLink } from 'react-router-dom';

function Header() {
  const navLinks = [
    ['Главная', '/'],
    ['Бани', '/bany'],
    ['Кухня', '/citchen'],
    ['Массаж', '/massages'],
    ['Контакты', '/contact']
  ];

  return (
    <header>
      <nav>
        {navLinks.map(([title, url]) => (
          <NavLink
            key={title}           
            to={url}             
            className={({ isActive }) => 
              isActive ? 'active-link' : ''  // ← опционально: стили для активной ссылки
            }
          >
            {title}
          </NavLink>
        ))}
      </nav>
    </header>
  );
}

export default Header;
